html,
body {
    margin: 0;
    font-family: "San Francisco", sans-serif;
    font-weight: 400;
    scroll-behavior: smooth;
    overflow-x: hidden;
}

a {
    text-decoration: none;
    color: black;
}

.page {
    margin-bottom: 0px;
    margin-top: 50px;
    width: 100%;
    position: relative;
    transition: 1s all;
    display: flex;
    flex-direction: column;
}

.group {
    display: flex;
    flex-direction: column;
    align-items: center;
}

.element {
    position: relative;
    transition: 0.5s all;
}

.hidden {
    display: none;
}

.message-block {
    line-height: 26px;
    position: relative;
    transition: 0.5s all;
    -webkit-transition: 0.5s all;
    -moz-transition: 0.5s all;
    -ms-transition: 0.5s all;
    -o-transition: 0.5s all;
}

.message-block-last {
    /* margin-bottom: 200px; */
}

.right .message,
.left .message {
    position: relative;
    transition: 1s opacity, all 0.4s;
    -webkit-transition: 1s opacity, all 0.4s;
    -moz-transition: 1s opacity, all 0.4s;
    -ms-transition: 1s opacity, all 0.4s;
    -o-transition: 1s opacity, all 0.4s;
    opacity: 0;
}

@keyframes bubbleleft {
    0% {
        opacity: 0;
        transform: rotate(-45deg) scaleX(-1);
        left: -3.5px;
    }

    100% {
        opacity: 1;
        transform: rotate(0) scaleX(-1);
    }
}

@keyframes bubbleRight {
    0% {
        opacity: 0;
        transform: rotate(45deg) scaleX(1);
        right: -4.5px;
    }

    100% {
        opacity: 1;
        transform: rotate(0) scaleX(1);
    }
}

.left>svg {
    position: absolute;
    left: -15.5px;
    bottom: -1px;
    transform: rotate(-45deg) scaleX(-1);
    animation: bubbleleft 0.4s ease 0.2s;
    animation-fill-mode: forwards;
    animation-delay: 0.4s;
    fill: #e5e4e9;
    opacity: 0;
}

.right>svg {
    position: absolute;
    right: -16.5px;
    bottom: -2px;
    transform: rotate(45deg) scaleX(1);
    animation: bubbleRight 0.4s ease 0.2s;
    animation-fill-mode: forwards;
    animation-delay: 0.4s;
    fill: #0253e2;
    opacity: 0;
}

.message-block .show {
    opacity: 1;
}

.right[data-emergence=hidden] .message {
    left: 500px;
}

.right[data-emergence=visible] .message {
    left: 0;
    opacity: 1;
}

.left[data-emergence=hidden] .message {
    left: -500px;
}

.left[data-emergence=visible] .message {
    left: 0px;
    opacity: 1;
}

.message-block {
    display: block;
    width: 100%;
    max-width: 675px; 
   /* max-width: 860px; */
    margin-bottom: 10px;
}

.message {
    display: inline-block;
    padding: 15px 25px;
    border-radius: 50px;
    font-size: 24px;
}

.right .message {
    background-color: #0253e2;
    color: white;
    float: right;
}

.left .message {
    color: #000000;
    background-color: #e5e4e9;
    color: rgb(59, 59, 59);
}

.gallery-container{
    width: 100%;
    position: relative;
    display: flex;
}

.gallery-block {
    display: flex;
    align-self: flex-start;
    margin-top: 50px;
    transition: 1s all;
}

.gallery-block .box {
    position: relative;
    width: 400px;
    height: 600px; 
    margin-right: 40px;
}

.box>img {
    height: 100%;
    width: 100%;
}

.gallery-block .thin-box {
    width: 250px;
    height: 400px;
}

.gallery-block-home-group {
    position: relative;
}

.gallery-block-show-me-your-work {
    position: relative;
}

.gallery-block-smooth-animation {
    position: relative;
}

.button-group {
    display: flex;
    justify-content: center;
    margin-top: 150px;
}


.btn {
    margin: 0 5px;
    background-color: transparent;
    padding: 10px 20px;
    border: 1px solid #dddddd;
    transition: 0.3s all;
    font-size: 20px;
    border-radius: 50px;
}

.btn:hover {
    background-color: #dddddd;
    cursor: pointer;
}

.btn:focus {
    border-color: #999999;
    outline: none;
}

@media screen and (max-width: 950px) {

    .message-block {
        width: 88%;
    }
    .gallery-block{
        margin-left: -125px;
    }

    .left{
        margin-left: 35px;
    }

    .right{
        margin-right: 35px;
    }

    .message {
        font-size: 16px;
        max-width: 270px;
    }

    .right>svg {
        right: -14.5px;
    }

    .left>svg {
        left: -14.5px;
    }

    .btn {
        padding: 7px 10px;
        font-size: 13px;
    }

    .gallery-block .box{
        max-width: 300px;
        height: 500px;
    }
}

@media screen and (max-width: 480px) {
    .left{
        margin-left: 50px;
    }

    .right{
        margin-right: 50px;
    }

    .message{
        padding: 7px 10px;
        font-size: 16px;
    }
    .btn {
        padding: 7px 10px;
        font-size: 14px;
    }
}






